import React from 'react';

const Contact = () => {
    return (
        <div>
            <h1>Контакты</h1>
            <p>Наш адрес: ул. Название, город, страна.</p>
            <p>Телефон для связи: +7 123 456 7890</p>
            <p>Email: example@example.com</p>
            {/* Добавьте другие способы связи или информацию о контактах */}
        </div>
    );
};

export default Contact;
